    this.primaryClick.emit();
  }

  onSecondaryClick() {
    this.secondaryClick.emit();
  }

  close() {
    this.closeClick.emit();
  }

  onCardClick(card: { src: string; text: string }) {
    this.cardClick.emit(card);
  }
